(12, 'asdasd', '["1111","3333","44444","555555"]', 'text', 'asdas', 0),
(13, 'dfdsf', '["<p>12332132<\\/p>","<p>345345345<\\/p>","<p>67567567567<\\/p>"]', 'html', 'fgdfg', 0),
(14, 'text1', '["<p>You can see that respondents picked ''emergencies'' at 66% and ''in trouble \\/ need it quick'' at 64% as the most likely circumstances that would trigger the use of a drone delivery service. An ''emergency'' is a subjective term that can mean just about anything, including the third most likely circumstance of a last minute anniversary or birthday gift - especially if you are desperate and have forgotten it. Bottom line - From this small study I see three interesting insights:<br \\/> <br \\/> 1. For the most part, consumers are willing to use a drone delivery service, but price matters.<br \\/> 2. Consumers are not willing to pay more than 30% of the item''s value for that delivery - most no more than 20%.<br \\/> 3. Electronics given as gifts will likely be the most ordered items.<br \\/> 4. Consumers consider medicine and batteries important and urgent enough for drone delivery.<br \\/> <br \\/> <img class=\\"pd_img5\\" src=\\"images\\/pd_img5.png\\" alt=\\"#\\" \\/> Here''s a simple example based on the data gathered: A consumer camera is ordered as a last minute gift and needs to be delivered in 30 minutes or less. <br \\/>The <a href=\\"http:\\/\\/www.trustedreviews.com\\/top-ten-cameras_round-up\\" target=\\"_blank\\">best enthusiast compact camera<\\/a> in 2014 is the Sony DSC-RX100M II Cyber-Shot Digital Still Camera. Its shipping weight is 3 pounds. <br \\/> At the date of this post, it lists <a href=\\"http:\\/\\/www.amazon.com\\/Sony-DSC-RX100M-Cyber-shot-Digital-Camera\\/dp\\/B00DM8R866\\/\\" target=\\"_blank\\">on Amazon<\\/a> for about US $650. If the drone delivery service charges 20%, then the extra cost will be US $130. If the drone delivery service charges 30%, then the extra cost would be US $195. Keep in mind this is an example only. We do not know how much Amazon Prime Air will charge for this or any other items - nor do we know what items actually qualify for the service. Regular Amazon Prime users know already that not all items qualify for its two-day delivery service since they ship from contracted suppliers. However, for comparative purposes today, if you were to order this item for U.S. overnight delivery to the West Coast, the charge would be approximately $34. <br \\/> <br \\/> I believe drone delivery is best suited to high value, lightweight merchandise, including some items at Walgreens, CVS, or Rite-Aid, and a meaningful portion of the merchandise at many other large retailers. In addition to consumer products delivered to households, drones can provide fast and cost-effective deliveries to remote, hazardous, or hard-to reach areas. Other applications for drone delivery include:<\\/p>"]', 'html', 'fgdfg', 0),
