(24, 'packagedeliveryconten3', '["<p>What do medicine, batteries, and forgotten anniversary gifts have in common? They are the most likely items consumers will want delivered by drone once that service is available. At least, that''s the verdict from the consumers I surveyed in August and September of this year. In my post <a href=\\"http:\\/\\/droneanalyst.com\\/2014\\/08\\/24\\/drone-delivery-how-much\\/\\" target=\\"_blank\\">Drone Delivery: How Much Would You Pay?<\\/a>, I ran a poll with three simple questions:<\\/p>"]', 'html', 'packagedeliveryconten3', 0),
(25, 'packagedeliveryconten4', '["<p>1. What''s the maximum amount you would be willing to pay for a package delivered by drone?<br \\/> 2. Which of ten items would you want delivered in 30 minutes?<br \\/> 3. Under what circumstance would you need something so quickly that you''d pay top dollar for it?<\\/p>"]', 'html', 'packagedeliveryconten4', 0),
