(47, 'packagedeliveryconten11', '["<p>Respondents could choose as many items as applies. Nearly three-quarters (72%) would use drone delivery to have a gift delivered. Over half (57%) chose electronics. Food and medicine were next highest on the list at 45% and 38%, respectively. Batteries were the most mentioned item in the ''other'' category.<br \\/> Food may not be a good candidate for drone delivery. Whether from the supermarket, mini-mart, fast food joint, or other restaurant, food is generally very inexpensive per pound. <br \\/> <br \\/> Circumstances under which you''d pay top delivery dollar? - Third, I wanted to know under what circumstances consumers would need something so quickly that they''d pay top dollar to have it delivered quickly. I looked at the same online shopping trends noted above for the most popular categories and top purchase drivers. Results appear in Figure 2.<\\/p>"]', 'html', 'packagedeliveryconten11', 0),
