INSERT INTO `jungleproduct` (`id`, `product_name`, `product_desc`, `category_id`, `product_file`, `status`, `priority`, `price`) VALUES
(1, 'product1', '<p>cccxxzczcxcxc</p>', 1, 'public://1458148736_1460724758.png', 1, 1, 0),
(3, 'product2', '<p>gfgdfgdfgd nbnnngfgggdg</p>', 2, 'public://1746808228_1460641964.jpg', 1, 2, 0),
(4, 'product3', '<p>ccxzczczc</p>', 4, 'public://726459788_1460730556.jpg', 1, 4, 0),
(5, 'Home', '<p>Landscape</p>', 4, 'public://1279374476_1460641949.jpg', 1, 5, 0),
(6, 'product5', '<p>This is beautiful image of greenery. The image displays the scene in the woods with sun reflecting from behind the trees. As far as our vision goes there is green all around which is very sooting for the eyes. This is an ideal image of the woods with a touch of greenery and a sense of being in the jungle.&nbsp;</p>', 4, 'public://1257983758_1460640649.jpg', 1, 6, 0),
(7, 'Abstract', '<p>Abstract image</p>', 10, 'public://185714920_1461069034.jpg', 1, 2, 0),
(8, 'Landscape design', '<p>abstract 2</p>', 10, 'public://847577921_1461068837.jpg', 1, 3, 0),
(9, 'Vacation 1', '<p>This is an image of people on vacation. Mostly the image focuses on beach vacation and people enjoying the sunbath on a beautiful sunny day in front of the ocean. The beautiful sandy beach and distant constructs which seems like built in the middle of the ocean makes the image all the more likable. This is one of the typical imagery of people enjoying their vacation and what can be more perfect a spot than a beautiful sea beach.</p>', 5, 'public://1418506850_1461059806.jpg', 1, 5, 0),
(10, '2.4Ghz 6 Axis Drone With Camera', '<p>Check out this cool quadcopter with the following features:Fly Up/Down, Go Forward/Backward, Turn Left/Right, Side Flying, Hover and Flip Over. Battery for UFO: 3.7V 580mAh Li-po with protection board (included). Battery for transmitter: 4*AA battery (not included). Rechargeable by the charger (included). Flying duration time: about 6-8 minutes. Charging time: about 60 minutes. Remote control distance: 50 meters.</p>', 18, 'public://39722034_1461144402.jpg', 1, 1, 0),
(11, 'X-Drone Nano With Blade Protection', '<p>As a perfect option as a present, this cool nano drone comes from the hub of Saffire. It features six axis gyro which makes it easy to start, by throwing out or fly from ground. This model is absolutely stable with fly and flip performance. It comes with easy control direction. Highly durable, this drone comes with three speed and two modes. The functions include fly up and down, go forward or backward, turn left and right, side flying, hover and flip over. This red and white quadcopter run with protection board. The remote control comes with a distance of forty metres.</p>', 18, 'public://1017516368_1461144812.jpg', 1, 2, 567),
(15, 'A2b 5 Channel Nano Quadcopter 6 Axis Gyro Mini Drone - a2b_nano_gyrodrone', '<p>Brought to you is the 4 Channel Mini Quadcopter whose superior control and hi tech features make it perfect to fly indoors as well as outdoors by your little one. Although small in size this quadcopter is packed with enormous power. Its 2.4 GHz 4 rotor concept makes it capable of doing acrobatics and 360 degree flips and stunts. Besides the quad rotor thrust also makes outdoor flying fast and stable. This helicopter also comes with a set of spare rotors to give your kid hours of excitement. Made from the high quality materials this quadcopter is durable and sturdy enough to withstand shock and impact. Moreover the use of 100 percent non toxic materials makes it safe for little kids.</p>', 18, 'public://346524230_1461145902.jpg', 1, 8, 0),
(13, 'X-Drone Evolution 6 Axis Quad Copter', '<p>Fly up/down, go forward/backward, turn left/right, side flying, hoverand flip over. Battery for UFO: 3.7V 300mAh Li-po with protection board (included). Battery for transmitter: 4*AA battery (not included). Rechargeable by the charger (included). Flying duration time: about 6-8 minutes. Charging time: about 60 minutes. Remote control distance: 30 meters.</p>', 18, 'public://2114504555_1461145560.jpg', 1, 3, 0),
(14, 'Defender Ufo 6 Channel Quad Copter', '<p><span id="hiddenContent" class="u-dspn" style="display: inline;">Enjoy your flight with this 4 Channel &amp; three-axis gyroscope Defender UFO. Experience the most innovative 3D flight mode locking, the most stable floating, ultra-easy control, you will really find this flying experience wonderful. Featuring 2.4G High Frequency Remote Control, the flight distance is well over 100 meters. It can fly faster, higher and farther than you can think. When you''ll become an expert, you can also perform a hands-on with aerial stunts, a key roll on this UFO. When flying, press the roll button on the remote control and you will see the UFO making a 360-degree roll about stunt.</span></p>', 18, 'public://1450801143_1461146205.jpg', 1, 9, 0),
(16, 'Hoten-X Mini Drone Quad Copter', '<p>Fly up/down, go forward/backward, turn left/right, side flying, hover and flip over. Battery for UFO: 3.7V 300mAh Li-po with protection board (included). Battery for transmitter: 4*AA battery (not included). Rechargeable by the charger (included). Flying duration time: about 6-8 minutes. Charging time: about 60 minutes. Remote control distance: 30 meters.</p>', 18, 'public://1105765298_1461146040.jpg', 1, 7, 0),
(17, 'DJI Phantom 3 Professional', '<p align="left">Take to the sky and capture your world in beautiful 4K video.</p>\n<p align="left">The Phantom 3 is an easy to use, fully integrated package with an intelligent system that helps you fly. Even when flying up to 1.2 miles (2km)* away, built-in Lightbridge technology gives you complete control over your Phantom 3 and an immersive, live HD view of everything below. Further adding a new dimension to your experience, automatic video editing software and livestreaming capabilities let you share what you see instantly.</p>', 19, 'public://759229344_1461146714.png', 1, 9, 1420.56),
(18, 'DJI Inspire1 with 1 remote controller', '<p>The Inspire 1 is a brand new quadcopter capable of capturing 4K video and able to transmit in high-definition video signal to multiple devices straight out of the box. With its transforming design, the 4K camera integrated with enhanced version of Lightbridge HD downlink comes together with the Inspire 1. This creates an easy to use, all in one flying platform that enpowers you to create the unforgettable experience.</p>', 19, 'public://319340863_1461146782.jpg', 1, 8, 385047),
(19, 'Rent DJI Phantom 2 Vision+ Drone', '<p>24-minute flight time per battery and a 3-axis gimbal for stabilization. What are you waiting for? This drone is a blast -- rent it today! If you''ve ever dreamed of flying, you need to try the Phantom 2 Vision+ by DJI. Even if you''ve never flown a quadcopter! Send this drone up 400 feet to snap a selfie of your house from an angle you''ve never seen before. Film a panorama of your town or neighborhood. The sky is the limit!<br /><br />And DJI''s built-in camera gives you 14 megapixels at a 120 degree field of view -- enough to capture everything. Shoot in full-frame 1080p video or take individual pictures with a resolution of 4384&times;3288. Did we mention the Phantom 2 Vision+ wirelessly pairs to your smartphone? See what the drone sees and make sure you frame the shot you want!</p>', 19, 'public://562821551_1461146938.jpg', 1, 7, 3956),
(20, 'Yuneec Typhoon Q500 4K', '<p><strong>&nbsp;</strong>We offer the Yuneec Typhoon Q500 4K for rent in Toronto. This is an excellent kit for film makers and real estate photographers. The package includes a gimbal adapter that allows you to detach the camera from the rental drone and produce steady on the ground footage. This drone rental kit is a cost effective pro solution.</p>', 19, 'public://252051996_1461147246.jpg', 1, 6, 2000),
(21, 'Draganflyer X8 UAV 5D', '<p>Our Dragonflyer X8 rental in Toronto comes pre-configured for a Canon 5D Mark III camera system. It is a truly professional UAV that is not recommended for beginners. It require two people to operate and prior knowledge of UAVs to troubleshoot. SkySnap requires proof of prior operation of similar UAVs.</p>', 19, 'public://254895109_1461147350.jpg', 1, 5, 3000);
